@Override
public void leaveToken(DetailAST ast) {
    if (ast.getType() == TokenTypes.LITERAL_CATCH) {
        final Optional<CatchParameterDetails> unusedCatchParameter = Optional.ofNullable(catchParameters.peek())
                .filter(parameter -> !parameter.isUsed())
                .filter(parameter -> !"_".equals(parameter.getName()));

        unusedCatchParameter.ifPresent(parameter -> {
            log(parameter.getParameterDefinition(),
                    MSG_UNUSED_CATCH_PARAMETER,
                    parameter.getName());
        });
        catchParameters.pop();
    }
}

private static boolean hasStringCaseLabel(DetailAST caseAST) {
    DetailAST curNode = caseAST;
    boolean hasStringCaseLabel = false;
    boolean exitCaseLabelExpression = false;
    while (!exitCaseLabelExpression) {
        DetailAST toVisit = curNode.getFirstChild();
        if (curNode.getType() == TokenTypes.STRING_LITERAL) {
            hasStringCaseLabel = true;
            break;
        }
        while (toVisit == null) {
            toVisit = curNode.getNextSibling();
            curNode = curNode.getParent();
        }
        curNode = toVisit;
        exitCaseLabelExpression = TokenUtil.isOfType(curNode,
                TokenTypes.COLON, TokenTypes.LAMBDA);
    }
    return hasStringCaseLabel;
}

private static boolean isLambdaParameterIdentifierCandidate(DetailAST identifierAst) {
    // we should ignore the ident if it is in the lambda parameters declaration
    final boolean isLambdaParameterDeclaration =
            identifierAst.getParent().getType() == TokenTypes.LAMBDA
            || identifierAst.getParent().getType() == TokenTypes.PARAMETER_DEF;

    return !isLambdaParameterDeclaration
            && (hasValidParentToken(identifierAst) || isMethodInvocation(identifierAst));
}

