    int argumentIndex = CompletionUtils.detectArgumentIndex(completion);
    if (argumentIndex == 1) {
        if (!completeBeanName(completion)) {
            super.complete(completion);
        }
        return;
    }
    if (argumentIndex == 2) {
        if (!completeAttributeName(completion)) {
