private HttpResponse readFileFromResource(FullHttpRequest request, String path) throws IOException {
    DefaultFullHttpResponse fullResp = null;
    InputStream in = null;
    try {
        URL res = HttpTtyConnection.class.getResource("/com/taobao/arthas/core/http" + path);
        if (res != null) {
            fullResp = new DefaultFullHttpResponse(
                request.protocolVersion(),
                HttpResponseStatus.OK
            );
            in = res.openStream();
            byte[] tmp = new byte[256];
            for (int l = 0; l != -1; l = in.read(tmp)) {
                fullResp.content().writeBytes(tmp, 0, l);
            }
            int li = path.lastIndexOf('.');
            if (li != -1 && li != path.length() - 1) {
                String ext = path.substring(li + 1);
                String contentType;
                if ("html".equals(ext)) {
                    contentType = "text/html";
                } else if ("js".equals(ext)) {
                    contentType = "application/javascript";
                } else if ("css".equals(ext)) {
                    contentType = "text/css";
                } else {
                    contentType = null;
                }

                if (contentType != null) {
                    fullResp.headers().set(HttpHeaderNames.CONTENT_TYPE, contentType);
                }
            }
        }
    } finally {
        IOUtils.close(in);
    }
    return fullResp;
}

@Override
public List<ResultModel> pollResults() {
    try {
        lastAccessTime = System.currentTimeMillis();
        long accessTime = lastAccessTime;
        if (lock.tryLock(500, TimeUnit.MILLISECONDS)) {
            polling = true;
            sendingItemCount = 0;
            long firstResultTime = 0;
            // sending delay: time elapsed after firstResultTime
            long sendingDelay = 0;
            // waiting time: time elapsed after access
            long waitingTime = 0;
            List<ResultModel> sendingResults = new ArrayList<ResultModel>(resultBatchSizeLimit);

            while (!closed
                    && sendingResults.size() < resultBatchSizeLimit
                    && sendingDelay < 100
                    && waitingTime < pollTimeLimit) {
                ResultModel aResult = resultQueue.poll(100, TimeUnit.MILLISECONDS);
                if (aResult != null) {
                    sendingResults.add(aResult);
                    // 
                    if (firstResultTime == 0) {
                        firstResultTime = System.currentTimeMillis();
                    }
                    // 
                    if (shouldFlush(sendingResults, aResult)) {
                        break;
                    }
                } else {
                    if (firstResultTime > 0) {
                        // 
                        sendingDelay = System.currentTimeMillis() - firstResultTime;
                    }
                    // 
                    waitingTime = System.currentTimeMillis() - accessTime;
                }
            }

            // resultQueue.drainTo(sendingResults, resultSizeLimit-sendingResults.size());
            if (logger.isDebugEnabled()) {
                logger.debug("pollResults: {}, results: {}", sendingResults.size(), JSON.toJSONString(sendingResults));
            }
            return sendingResults;
        }
    } catch (InterruptedException e) {
        // e.printStackTrace();
    } finally {
        if (lock.isHeldByCurrentThread()) {
            lastAccessTime = System.currentTimeMillis();
            polling = false;
            lock.unlock();
        }
    }
    return Collections.emptyList();
}

@Override
public void draw(CommandProcess process, DashboardModel result) {
    int width = process.width();
    int height = process.height();

    //  thread top memory, gc  tomcat,
    // runtime 
    int totalHeight = height - 1;
    int threadTopHeight;
    if (totalHeight <= 24) {
        //  1/2
        threadTopHeight = totalHeight / 2;
    } else {
        //  1/3 (24/2=12)
        threadTopHeight = totalHeight / 3;
        if (threadTopHeight < 12) {
            threadTopHeight = 12;
        }
    }
    int lowerHalf = totalHeight - threadTopHeight;

    // Memory  8 ,  metaspace 
    int memoryInfoHeight = lowerHalf / 2;
    if (memoryInfoHeight < 8) {
        memoryInfoHeight = Math.min(8, lowerHalf);
    }

    // runtime
    TableElement runtimeInfoTable = drawRuntimeInfo(result.getRuntimeInfo());
    // tomcat
    TableElement tomcatInfoTable = drawTomcatInfo(result.getTomcatInfo());
    int runtimeInfoHeight = Math.max(
        runtimeInfoTable.getRows().size(),
        tomcatInfoTable == null ? 0 : tomcatInfoTable.getRows().size()
    );
    if (runtimeInfoHeight < lowerHalf - memoryInfoHeight) {
        //  runtimeInfo  MemoryInfo 
        memoryInfoHeight = lowerHalf - runtimeInfoHeight;
    } else {
        runtimeInfoHeight = lowerHalf - memoryInfoHeight;
    }

    //  MemoryInfo  ThreadHeight
    int maxMemoryInfoHeight = getMemoryInfoHeight(result.getMemoryInfo());
    memoryInfoHeight = Math.min(memoryInfoHeight, maxMemoryInfoHeight);
    threadTopHeight = totalHeight - memoryInfoHeight - runtimeInfoHeight;

    String threadInfo = ViewRenderUtil.drawThreadInfo(
        result.getThreads(), width, threadTopHeight
    );
    String memoryAndGc = drawMemoryInfoAndGcInfo(
        result.getMemoryInfo(), result.getGcInfos(), width, memoryInfoHeight
    );
    String runTimeAndTomcat = drawRuntimeInfoAndTomcatInfo(
        runtimeInfoTable, tomcatInfoTable, width, runtimeInfoHeight
    );

    process.write(threadInfo + memoryAndGc + runTimeAndTomcat);
}

